import React from 'react';

class ReportQuestion extends React.Component {
    render() {
       // const kmom = this.props.match.params.kmom;
        fetch("http://localhost:8333/reports/" + 1, {
            method: "GET",
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
        }).then((res) => {
            return res.json()
        }).then((res) => {
            console.log(res);

        });


        return (
            <div className="question_input_container">
                <label>
                    Question
                <textarea name="question" type="textarea"/>
                </label>
                <label>
                    Answer
                <textarea name="answer" type="textarea"/>
                </label>
                </div>

        )
    }
}


export default ReportQuestion;
